function change(location) {
	if(location == 1) {
		page.style.width = generate.offsetWidth + "px";
		page.style.marginLeft = "0px";
		genContent.classList.remove("notShown");
		valContent.classList.add("notShown");
		memContent.classList.add("notShown");
	} else if (location == 2) {
		page.style.width = validate.offsetWidth + "px";
		page.style.marginLeft = validateLoc + "px";
		genContent.classList.add("notShown");
		valContent.classList.remove("notShown");
		memContent.classList.add("notShown");
	} else {
		page.style.width = memorize.offsetWidth + "px";
		page.style.marginLeft = memorizeLoc + "px";
		genContent.classList.add("notShown");
		valContent.classList.add("notShown");
		memContent.classList.remove("notShown");
	}
}

function genCustomCharChange() {
	if(genCustomChar.value.length > 0) {
		genCustomCharCheck.checked = true;
	} else {
		genCustomCharCheck.checked = false;
	}
}

function genGeneratePassword() {
	var length;
	if(genSpecificLength.value != "") {
		length = parseInt(genSpecificLength.value);
	} else {
		var min = 10;
		var max = 16;
		if(genMax.value != "") {
			max = parseInt(genMax.value);
		}
		if(genMin.value != "") {
			min = parseInt(genMin.value);
		}
		length = parseInt(Math.min(min,max) + (Math.abs(max - min) + 1) * Math.random());
	}
	var characterList = "";
	if(genAlphabet.checked) {
		characterList += genAlphabetList;
	}
	if(genNumbers.checked) {
		characterList += genNumbersList;
	}
	if(genPunctuation.checked) {
		characterList += genPunctuationList;
	}
	if(genOtherNonalphanumericCharacters.checked) {
		characterList += genOtherNonalphanumericCharactersList;
	}
	if(genCustomCharCheck.checked) {
		var string = genCustomChar.value;
		string = deleteChar(string," ");
		for(i = 0; i < characterList.length; i++) {
			string = deleteChar(string,characterList.substring(i,i+1));
		}
		characterList += string;
	}
	var output = "";
	for(i = 0; i < length; i++) {
		var location = parseInt(Math.random() * characterList.length);
		output += characterList.substring(location,location + 1);
	}
	genPassword.innerHTML = output;
	genAnalyze(output);
}

//duplication of the analyzing code to work with the generate section. I probably could do it cleaner and with less code, but I don't feel like putting in the effort yet

function genAnalyze(input) {
	var password = input;
	genFixes.innerHTML = "";
	var lengthScore = genAnalyzeLength(password);
	var varietyScore = genAnalyzeVariety(password);
	var patternScore = genAnalyzePatterns(password);
	var score = Math.round(0.2 * lengthScore + 0.2 * varietyScore + 0.6 * patternScore);
	genScoreBarInner.style.width = score + "%";
	if(score <= 60) {
		genPercentage.style.color = "#CC2200";
	} else if(score <=80) {
		genPercentage.style.color = "#CCCC00";
	} else if(score < 85) {
		genPercentage.style.color = "#99CC00";
	} else if(score < 95) {
		genPercentage.style.color = "#55CC00";
	} else {
		genPercentage.style.color = "#00CC00";
	}
	genPercentage.innerHTML = score + "%";
	genScoreContainer.style.opacity = "1";
	genCategories.style.opacity = "1";
	console.log("done");
}

function genAnalyzeLength(password) {
	var score = (password.length / 10 * 100);
	if(score > 100) {
		score = 100;
	}
	genLength.innerHTML = "<img src=\"Pictures/length.png\"><br>Length: " + score + "%<span>Tests the length of the password. The longer the password, generally the more secure the password.</span>";
	if(password.length < 10) {
		genFixes.innerHTML += "Short password, add at least " + (10 - password.length) + " characters<br>";
	}
	return score;
}

function genAnalyzeVariety(password) {
	var score = 0;
	score += genAnalyzeVarietyHelper(password,genAlphabetList.substring(0,26),"lower case letters"); //gets lower case
	score += genAnalyzeVarietyHelper(password,genAlphabetList.substring(26,genAlphabetList.length),"capital letters"); //gets Upper Case
	score += genAnalyzeVarietyHelper(password,genNumbersList,"numbers"); //gets numbers
	score += genAnalyzeVarietyHelper(password,genPunctuationList + genOtherNonalphanumericCharactersList,"non alphanumeric characters");
	score = score / 8 * 100
	genVariety.innerHTML = "<img src=\"Pictures/variety.png\"><br>Variety: " + Math.round(score) + "%<span>Tests to make sure there are a variety of types of characters. The more variety, generally the more secure the password.</span>";
	return score;
}

function genAnalyzeVarietyHelper(password,string,type) {
	var count = 0;
	for(i = 0; i < string.length; i++) {
		if(password.indexOf(string.substring(i,i+1)) != -1) {
			count++;
		}
		if(count >= 2) {
			break;
		}
	}
	if(count < 2) {
		genFixes.innerHTML += "If possible, add " + (2 - count) + " more " + type + "<br>";
	}
	return count;
}

function genAnalyzePatterns(password) {
	var checkList = [commonWords];
	password = password.toLowerCase();
	var count = 0;
	for(i = 0; i < checkList.length; i++) {
		for(j = 0; j < checkList[i].length; j++) {
			if(checkList[i][j].length <= 2) {
				continue;
			}
			if(password.indexOf(checkList[i][j].toLowerCase()) != -1) {
				count += 20 / Math.floor((j + 1)/1000);
				genFixes.innerHTML += "Remove the word \"" + checkList[i][j].toLowerCase() + "\"<br>";
			}
			var leet = valToLeet(checkList[i][j].toLowerCase());
			for(k = 1; k < leet.length; k++) {
				if(password.indexOf(leet[k]) != -1) {
					genFixes.innerHTML += "Remove the Leet Speak version of \"" + leet[0] + "\"<br>"; 
					count += 10 / Math.ceil((j + 1)/1000);
				}
			}
		}
	}
	for(i = 0; i < commonPasswords.length; i++) {
		if(password.indexOf(commonPasswords[i].toLowerCase()) != -1) {
			count += 200 / Math.ceil((i + 1) / 1000);
			genFixes.innerHTML += "Remove common password #" + (i + 1) + ": \"" + commonPasswords[i].toLowerCase() + "\" now<br>";
		}
	}
	var score = 100 - Math.round(count);
	if(score < 0) {
		score = 0;
	}
	genPatterns.innerHTML = "<img src=\"Pictures/patterns.png\"><br>Patterns: " + score + "%<span>Tests for known patterns and common passwords. The more patterns, generally the less secure the password.</span>"
	return score;
}

